INSERT INTO `m0kux_boutique` (`id`, `name`, `description`, `information`, `opening`, `image`, `lat`, `lng`) VALUES
(123, 'Amager Isenkram', '<p><strong>Velkommen til Amagercentrets bedste Isenkram</strong><br /> <br /> I vores butik finder du stort set alt du kan tænke dig til køkkenet, borddækningen og personlig pleje. Derudover har vi et stort udvalg i plast og rengøringsartikler.<br /> Vi har et stort udvalg af Scanpan gryder, pander og knive. Og vi har stort set alt tilbehør til køkkenet, såsom vinåbnere, dåseåbnere, rivejern, osteskærere og meget andet - kom ind og se vores store udvalg.<br /> <br /> I afdelingen for el-apparater finder du alt til den personlige pleje samt kaffemaskiner, mikroovne, støvsugere og meget mere.<br /> <br /> Som de fleste af vores kunder ved, kan man altid finde et godt tilbud i blandt vores varer. Vi bruger meget tid på at finde nogle gode restpartier fra vores mange leverandører, det kommer naturligvis vores kunder til fordel.<br /> <br /> Kig forbi – vi kan altid finde den gave, der passer.<br /> <br /> I butikken møder du vores friske og veloplagte medarbejdere, der altid er klar til at hjælpe og evt. fremskaffe den vare, du måtte ønske.<br /> Vi tager imod de fleste konto- eller kreditkort, og vi opretter gerne lokale konti til kommuner og institutioner.<br /><br /> <br />Vi gør i øvrigt opmærksom på, at vi i centeret også har en butik der fører værktøj, pærer og lamper og meget andet. INSERT INTO `m0kux_categories` (`id`, `asset_id`, `parent_id`, `lft`, `rgt`, `level`, `path`, `extension`, `title`, `alias`, `note`, `description`, `published`, `checked_out`, `checked_out_time`, `access`, `params`, `metadesc`, `metakey`, `metadata`, `created_user_id`, `created_time`, `modified_user_id`, `modified_time`, `hits`, `language`) VALUES
