(8, 49, 'Profil', 'profil', '', '<p>Amager Isenkram – din isenkræmmer består af 3 butikker, et stort fjernlager plus en Web-shop der alle er beliggende på Amager og ejet af Henrik Jørgensen.<br /><br /></p>\r\n<p>Henrik Jørgensen startede sin første butik for 25 år siden og i 1991 åbnede han Gør Det Selv Shop i Amagercentret, som har et bredt udvalg af lamper, værktøj, badeværelsesudstyr, udstyr til haven og meget, meget mere.<br /><br /></p>\r\n<p>I 1996 kom så Amager Isenkram i Amagercentret til, som sælger gaveartikler, porcelæn, køkkenudstyr, el-apparater m.m. Butikken her udvider i 2013, hvor en flot stor ny butik vil så klar 1.9.2013.</p>\r\n<p><br />Tårnby Torv Isenkram blev købt i 1997 og har et stort udvalg af gaveartikler, porcelæn, køkkenudstyr, el-apparater og sælger også havemøbler, haveredskaber, lamper, badeværelsesudstyr og værktøj og meget mere.</p>\r\n<p><br />Vores Web-shop åbnede i 2013 og for alle butikkerne gælder at vi lægger vægt på at kunderne skal have en god oplevelse med god kvalificeret kundebetjening af vore 35 gode medarbejdere som altid kan give råd og vejledning.</p>\r\n<p><br />Vi sælger både mærkevarer og også varer som er mere dagligdags og vi rejser rundt i hele verden for at finde gode tilbud så vi kan sælge varer til gode priser.</p>\r\n<p><br />Besøg os enten i vore butikker eller på Web-shoppen og se hvilke gode varer og tilbud vi kan give dig netop nu.</p>\r\n<p><br /><br />Tårnby Torv Isenkram -Din Isenkræmmer<br />Selskabets CVR-nr. : 20477474<br />Etableringsform: ApS<br />Indehaverens navn: Henrik Jørgensen<br /> <br />Selskabets adresse:<br /> <br />Tårnby torv isenkram<br />Tårnby torv 9<br />2770 Kastrup<br /><br /><br /><br /></p>', '', 1, 0, 0, 2, '2013-02-01 03:05:27', 939, '', '2013-05-11 10:59:35', 972, 972, '2013-05-11 10:59:35', '2013-02-01 03:05:27', '0000-00-00 00:00:00', '{"image_intro":"images\\/banners\\/Amager-Isenkram.jpg","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 9, 0, 9, '', '', 1, 355, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(9, 50, 'Kontakt os', 'kontakt-os', '', '<p>For henvendelser til Amager isenkram beder vi dig udfylde vores kontaktformular på højre side.</p>\r\n<p>For bedre at kunne servicere dig, beder vi dig være så præcis i dine oplysninger som muligt<br />Vi svarer derefter så hurtigt som muligt - og inden for 1-3 hverdage.</p>', '', 1, 0, 0, 2, '2013-02-05 04:26:12', 939, '', '2013-05-15 17:08:15', 939, 0, '0000-00-00 00:00:00', '2013-02-05 04:26:12', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 0, 8, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
