(95, 'Footer', '', '<div class="copyright">\r\n<p>Copyright © 2013 - Amager Din Isenkræmmer</p>\r\n</div>\r\n<div class="payment">\r\n<ul>\r\n<li><a href="#"><img src="templates/amager/img/icon-dk.gif" border="0" alt="" width="36" height="20" /></a></li>\r\n<li><a href="#"><img src="templates/amager/img/icon-mastercard.gif" border="0" alt="" width="36" height="20" /></a></li>\r\n<li><a href="#"><img src="templates/amager/img/icon-card2.gif" border="0" alt="" width="36" height="20" /></a></li>\r\n<li><a href="#"><img src="templates/amager/img/icon-visa.gif" border="0" alt="" width="36" height="20" /></a></li>\r\n<li><a href="#"><img src="templates/amager/img/visa2.png" border="0" alt="" width="34" height="19" /></a></li>\r\n</ul>\r\n<div class="ean"><a href="#"><img src="templates/amager/img/img-ean-faktura.png" border="0" alt="" width="115" height="19" /></a></div>\r\n</div>\r\n<div class="design-by">\r\n<p><a href="http://www.mywebcreations.dk/" target="_blank">Design af My Web Creations</a></p>\r\n</div>', 1, 'footer', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"0","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(96, 'functions', '', '<div class="func">\r\n<div class="w-135"><img src="templates/amager/img/phone.png" border="0" alt="" width="17" height="16" /> <span>3250 3611</span></div>\r\n<!--.w-135-->\r\n<div class="w-135"><img src="templates/amager/img/times.png" border="0" alt="" width="14" height="17" /> <span>Hurtig levering</span></div>\r\n<!--.w-135-->\r\n<div class="w-135" style="width: 235px;"><img src="templates/amager/img/truck.png" border="0" alt="" width="17" height="14" /> <span>Gratis fragt ved køb over 500 kr.</span></div>\r\n<!--.w-135-->\r\n<div class="clear"></div>\r\n<div class="w-135"><img src="templates/amager/img/sticker.png" border="0" alt="" width="15" height="16" /> <span>Sikker betaling</span></div>\r\n<!--.w-135-->\r\n<div class="w-135"><img src="templates/amager/img/star.png" border="0" alt="" width="13" height="16" /> <span>14 dages returret</span></div>\r\n<!--.w-135-->\r\n<div class="w-135" style="width: 235px;"><img src="templates/amager/img/sitting.png" border="0" alt="" width="17" height="16" /> <span>2 års reklamationsret</span></div>\r\n<!--.w-135--></div>', 1, '', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{"prepare_content":"1","backgroundimage":"","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
