(331, '', 'Diameter.: 10.5 x 15,5 cm højde', 'Funktion - Bøfformer hvid plast', '', '', '', 'funktion-bofformer-hvid-plast'),
(332, '', 'Margrethe-skålen er designet for Rosti i 1954 af Sigvard Bernadotte og Acton Bjørn, og den er opkaldt efter den daværende kronprinsesse Margrethe af Danmark.Fås i et væld af flotte farver og hele 10 forskellige størrelser. Se også serien Margrethe DUO - farvet udenpå og hvid indeni. Margrethe røreskålen er produceret i 100% melamin, hvilket har den gode egenskab i forhold til plastik, at det holder formen, selv ved opvarmning. Melamin er velegnet til opvaskemaskine, men kan ikke bruges i mikroovn og fryser. Melamin har den gode egenskab i forhold til plastik, at det holder formen selv ved opvarmning, hvilket er en stor fordel i forbindelse med madlavning.', 'Rosti  - Røreskål 150ml Margrethe Hvid', '', '', '', 'rosti-roreska-l-150ml-margrethe-hvid'),
