INSERT INTO `m0kux_virtuemart_vendors_da_dk` (`virtuemart_vendor_id`, `vendor_store_desc`, `vendor_terms_of_service`, `vendor_legal_info`, `vendor_store_name`, `vendor_phone`, `vendor_url`, `slug`) VALUES
(1, '', '<p><strong>Tårnby Torv Isenkram -Din Isenkræmmer </strong></p>\r\n<p> </p>\r\n<p><strong>Selskabsoplysninger</strong></p>\r\n<p><strong>Selskabets navn :</strong> Tårnby Torv - Din isenkræmmer</p>\r\n<p><strong>Selskabets CVR-nr. :</strong> 20477474</p>\r\n<p><strong>Etableringsform:</strong> ApS</p>\r\n<p><strong>Indehaverens navn:</strong> Henrik Jørgensen</p>\r\n<p> </p>\r\n<p><strong>Selskabets adresse: </strong></p>\r\n<p> </p>\r\n<p>Tårnby torv isenkram</p>\r\n<p>Tårnby torv 9</p>\r\n<p>2770 Kastrup</p>\r\n<p> </p>\r\n<p>Tlf. 32503611</p>\r\n<p>Email : TTI@amagerisenkram.dk</p>\r\n<p> </p>\r\n<p><strong>Returadresse for ordrer: </strong></p>\r\n<p>Tårnby torv isenkram</p>\r\n<p>Tårnby torv 9</p>\r\n<p>2770 Kastrup</p>\r\n<p> </p>\r\n<p>Tlf.nr. : +45 32 50 36 11</p>\r\n<p>Email : info@amagerisenkram.dk</p>\r\n<p><strong> </strong></p>\r\n<p><strong>Vi tager forbehold for udsolgte varer, produkt- og prisændringer.</strong></p>\r\n<p> </p>\r\n<p><strong>Alle priser er inklusive moms og andre afgifter. </strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong>Betaling</strong></p>\r\n<p>Hos amager isenkrams web shop kan du betale med følgende betaling midler.                <br />          -Betalingskort<br />           -EAN nummer (offentlig instans)</p>\r\n<p><strong>Betalingskort: <br /> </strong>Hos <a href="http://www.amagerisenkram.dk/">www.amagerisenkram.dk</a> kan du betale med følgende betalingskort:</p>\r\n<p>- Dankort<br /> - MasterCard<br /> - Maestro<br /> - Visa<br /> - Visa Electron<br /> - JCB <br /> -</p>\r\n<p>PENGENE BLIVER FØRST TRUKKET VED AFSENDE AF VAREN!</p>\r\n<p><strong>EAN Nummer: <br /> </strong>Varerne sendes først når betalingen er registreret på vores konto.</p>\r\n<p>Konto til indbetaling af penge:</p>\r\n<p>Reg.: 5019<br /> Konto.:        1284004</p>\r\n<p><strong>Forsendelse og levering i danmark .Levering sker med Post Danmark.</strong> Ved køb over kr. 500,- leverer amager isenkram dine varer fragtfrit – under 500 koster det dog kr. 50,-. Dog ved ekstra tunge forsendelser (som støvsugere, ovne, parasolføder OSV.)  vil blive opkrævet et ekstra gebyr for fragten, vil det stå over knappen ”læg i indkøbskurven” i webshoppen, som en note og vil fremgå af ordrebekræftelsen.</p>\r\n<p>Hvis dele af ordren returneres, så ordrens samlet pris kommer under kr. 500,- vil fragten (50,-) blive fratrukket det returnerede.</p>\r\n<p>Levering sker normalt inden for 2-5 hverdage (lidt længere tid, hvis varen ikke er på lager og hvis ordren skal til udlandet). Kunden kontaktes via e-mail hvis varen er forsinket. Hvis ordren nægtes ved modtagelsen, der er oplyst mangelfuld adresse. at modtagernavn ikke står skrevet på postkasse/døren, eller ikke afhentes fratrækkes returbeløbet fragt samt et gebyr på kr. 100 for ekspedition.</p>\r\n<p>Ved fejl eller mangler ved leveringen, skal Tårnby Torv kontaktes inden 3 hverdage.</p>\r\n<p><strong>Fortrydelsesret</strong></p>\r\n<p>Fortryder du købet, bedes du, for egen regning, sende varen tilbage til ovenstående adresse senest den 14. dag efter modtagelsen. Hvis købet fortrydes bedes du returnere varen ubrugt i den originale emballage da den originale emballage repræsenterer en ikke uvæsentlig værdi for amagerisenkram, og varen således ikke kan anses for at være returneret i væsentligt samme stand og mængde, hvis den originale emballage mangler eller er beskadiget. I værste fald vil manglende original emballage betyde at du ikke vil kunne fortryde dit køb. Ved fortrydelse af købet, vil pengene blive indsat på din bankkonto. Du bedes oplyse om dit reg.nr. og kontonr. på din bank ved returnering af varer.</p>\r\n<p><strong>Returadresse:</strong></p>\r\n<p>Tårnby torv isenkram</p>\r\n<p>Tårnby torv 9</p>\r\n<p>2770 Kastrup</p>\r\n<p><strong> </strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong>Registrering af oplysninger</strong></p>\r\n<p>Ingen personlige oplysninger der registreres <a href="http://www.amagerisenkram.dk/">www.amagerisenkram.dk</a>, bliver på noget tidspunkt overdraget, solgt eller gjort tilgængelige for tredjemand. Alle informationer opbevares på betryggende vis, og er kun tilgængelige for betroede medarbejdere hos Amagerisenkram’s Webshop.</p>\r\n<p> </p>\r\n<p>I forbindelse med evt. elektronisk betaling bruges en sikker krypteret metode gennem Webshopsystemet. Det er godkendt udbyder med godkendelse fra E-mærket.</p>\r\n<p> </p>\r\n<p>Shopsystemet anvender såkaldte cookies til styring af indholdet i indkøbsvognen. En cookie er blot betegnelsen for en fil som gemmes på din egen PC. Det er desuden muligt at bede systemet gemme egne adresseoplysninger til næste besøg . Ønsker man på et senere tidspunkt at slette disse informationer, kan dette ske via browserindstillingerne. I Internet Explorer sker det eksempelvis via menuen "Funktioner" og menupunktet "Internetindstillinger".</p>\r\n<p> </p>\r\n<p>Under et køb udbeder vi os navn, adresse, telefonnummer og emailadresse. Disse informationer bruges udelukkende til behandling af ordren. Informationerne transmitteres og lagres elektronisk på ukrypteret form, og gemmes i 5 år. Selve "kontrakten" (købsaftalen) lagres ikke hos amagerisenkram - din Isenkræmmer ApS på en måde, så du senere kan logge dig ind og se/ændre status.</p>\r\n<p> </p>\r\n<p>Desuden registrerer vi IP-adressen hvorfra evt. køb foretages. Informationen finder normalt ingen anvendelse, men kan bruges i en evt. politiefterforskning. Alle falske bestillinger politianmeldes!</p>\r\n<p> </p>\r\n<p>Man kan desuden valgfrit få sin emailadresse optaget på en mailingliste (Nyhedsbrev) hos Amagerisenkram – Tårnby torv isekram ApS, således at man løbende modtager nyheder og anden information fra amagerisenkram -  din Isenkræmmer . Denne service kan til enhver tid tilmeldes og frameldes som man ønsker.</p>\r\n<p> </p>\r\n<p>Jvf. persondataloven oplyser vi på forespørgsel om registrerede oplysninger og på baggrund af evt. indsigelser foretager vi sletning i det omfang det ønskes.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p><strong>Reklamationsbehandling</strong></p>\r\n<p>Ved fejl eller mangler på varen, kan kunden klage til ovenstående adresse, telefonnummer eller e-mail. Kunden har 2 års reklamationsret. Kunden kan vælge at sende varen tilbage, eller møde op på den ovenstående adresse.</p>\r\n<p> </p>\r\n<p>Når du handler på amagerisenkram.dk har du 2 års reklamationsret. Dette betyder, at du enten kan få varen repareret, ombyttet, pengene tilbage eller afslag i prisen, afhængig af den konkrete situation. Dette betinger selvfølgelig at reklamationen er berettiget, og at manglen ikke er opstået som følge af en fejlagtig brug af produktet eller anden skadeforvoldende adfærd. Der skal reklameres inden rimelig tid efter at du har opdaget manglen ved varen.</p>\r\n<p> </p>\r\n<p>Vi refunderer rimelige fragtomkostninger, som du måtte have i forbindelse med returnering af varen, når reklamationen er berettiget.</p>', '', 'Amager', '', '', 'amager');
